public List<FpgaDevice> discover() throws ResourceHandlerException {
  List<FpgaDevice> list =
      plugin.discover(FpgaDiscoverer.MAX_EXEC_TIMEOUT_MS);
  if (list.isEmpty()) {
    throw new ResourceHandlerException("No FPGA devices detected!");
  }

  return list;
}
